// import React, { Component, Fragment } from 'react'
import React, { useState, Fragment } from 'react';
import { Route, Routes } from 'react-router-dom';
import { v4 as uuid } from 'uuid';

// import AuthenticatedRoute from './components/shared/AuthenticatedRoute'
import AutoDismissAlert from './components/shared/AutoDismissAlert/AutoDismissAlert';
import Header from './components/shared/Header';
import RequireAuth from './components/shared/RequireAuth';
import Home from './components/Home';
import SignUp from './components/auth/SignUp';
import SignIn from './components/auth/SignIn';
import SignOut from './components/auth/SignOut';
import ChangePassword from './components/auth/ChangePassword';
import ShowExpense from './components/expenses/ShowExpense';
import CreateExpense from './components/expenses/CreateExpense';
import IndexExpenses from './components/expenses/IndexExpenses';
import ShowDeposit from './components/deposits/ShowDeposit';
import CreateDeposit from './components/deposits/CreateDeposit';
import IndexDeposits from './components/deposits/IndexDeposits';


const App = () => {
  const [user, setUser] = useState(null);
  const [msgAlerts, setMsgAlerts] = useState([]);

  console.log('user in app', user);
  console.log('message alerts', msgAlerts);
  const clearUser = () => {
    console.log('clear user ran');
    setUser(null);
  };

  const deleteAlert = (id) => {
    setMsgAlerts((prevState) => {
      return prevState.filter((msg) => msg.id !== id);
    });
  };

  const msgAlert = ({ heading, message, variant }) => {
    const id = uuid();
    setMsgAlerts(() => {
      return [{ heading, message, variant, id }];
    });
  };

  return (
    <Fragment>
      <Header user={user} />
      <Routes>

        <Route 
        path="/" element={
        <RequireAuth user={user}>
          <Home msgAlert={msgAlert} user={user} />
        </RequireAuth>
        } 
        />
        <Route
          path="/sign-up"
          element={<SignUp msgAlert={msgAlert} setUser={setUser} />}
        />
        <Route
          path="/sign-in"
          element={<SignIn msgAlert={msgAlert} setUser={setUser} />}
        />
        <Route
          path="/sign-out"
          element={
            <RequireAuth user={user}>
              <SignOut msgAlert={msgAlert} clearUser={clearUser} user={user} />
            </RequireAuth>
          }
        />
        <Route
          path="/change-password"
          element={
            <RequireAuth user={user}>
              <ChangePassword msgAlert={msgAlert} user={user} />
            </RequireAuth>
          }
        />
		    <Route
          path="/expenses"
          element={
            <RequireAuth user={user}>
              <IndexExpenses msgAlert={msgAlert} user={user} />
            </RequireAuth>
          }
        />
		    <Route
          path="/expenses/:id"
          element={<ShowExpense msgAlert={msgAlert} user={user} />}
        />
		    <Route
          path="/addExpense"
          element={
            <RequireAuth user={user}>
              <CreateExpense msgAlert={msgAlert} user={user} />
            </RequireAuth>
          }
        />
         <Route
          path="/expensesByCategory/"
          element={<ExpensesByCategory msgAlert={msgAlert} user={user} />}
        />
		    <Route
          path="/deposits"
          element={
            <RequireAuth user={user}>
              <IndexDeposits msgAlert={msgAlert} user={user} />
            </RequireAuth>
          }
        />
		    <Route
          path="/deposits/:id"
          element={<ShowDeposit msgAlert={msgAlert} user={user} />}
        />
        <Route
          path="/addDeposit"
          element={
            <RequireAuth user={user}>
              <CreateDeposit msgAlert={msgAlert} user={user} />
            </RequireAuth>
          }
        />
      </Routes>
      {msgAlerts.map((msgAlert) => (
        <AutoDismissAlert
          key={msgAlert.id}
          heading={msgAlert.heading}
          variant={msgAlert.variant}
          message={msgAlert.message}
          id={msgAlert.id}
          deleteAlert={deleteAlert}
        />
      ))}
    </Fragment>
  );
};

export default App;
